  const [buttonState, setbuttonState] = useState(true);

  const handleButtonPress = () => { setbuttonState(prev => !prev);

  }
  return (


          <Switch>          <Route exact path='/'>
          <Homepage buttonstate={buttonState} callback={handleButtonPress} />
                    </Route>
                    <Route exact path='/test'>
          <Homepage buttonstate={buttonState} callback={handleButtonPress} />
